import React from "react";
import './Background.scss';

function Logo() {
    return (
        <div className="background">
                <svg width="100vw" height="100vh">
                    <rect width="100vw" height="100vh" style={{fill:"#231F20",position:"fixed"}} />
                </svg>
        </div>
    );
}

export default Logo;
